import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,

} from "react-router-dom";

import React, { Component } from 'react'
import News from './Components/News';
import NavBar from './Components/NavBar';


export default class App extends Component {



  render() {
    return (
      <Router>
      <div>  
        <NavBar/>
          <Routes>
            <Route exact path="/" element={<News key="home" />}/>
            <Route exact path="/business" element={<News category="business" key="business" heading=" Top Business Headlines..."/>}/>
            <Route exact path="/entertainment" element={<News category="entertainment" key="entertainment" heading=" Top Entertainment Headlines..."/>}/>
            <Route exact path="/general" element={<News category="general" key="general" heading=" Top General..."/>}/>
            <Route exact path="/health" element={<News category="health" key="health" heading=" Top Health Headlines..."/>}/>
            <Route exact path="/science" element={<News category="science" key="science"  heading=" Top Science Headlines..."/>}/>
            <Route exact path="/sports" element={<News category="sports" key="sports"  heading=" Top Sports Headlines..."/>}/>
            <Route exact path="/technology" element={<News category="technology" key="technology"/>}/>

            <Route exact path="/" element={<News key="home"/>}/>
            <Route exact path="/in" element={<News country="in" key="in"/>}/>
            <Route exact path="/us" element={<News country="us" key="us"/>}/>
            <Route exact path="/au" element={<News country="au" key="au"/>}/>
            <Route exact path="/ua" element={<News country="ua" key="ua"/>}/>
            <Route exact path="/ue" element={<News country="ue" key="ue"/>}/>
            <Route exact path="/ru" element={<News country="ru" key="ru"/>}/>
            <Route exact path="/il" element={<News country="il" key="il"/>}/>
          </Routes>
      </div>
      </Router>
    )
  }
}
